REGRAS
1 - Fique na frente do quartel;

2 - Não vá para a Esplanada;

3 - Confie nas Forças Armadas e no Presidente Bolsonaro;

4 - Esqueça políticos, eles não servem para nada e nunca ajudam em nada a anos;

5 - Infiltrados sempre discordam de algum dos tópicos acima;

6 - Nunca escute infiltrados;

7 - Infiltrados sempre agem juntos e criam um falso debate;

8 - Infiltrados sempre querem debater um plano B para tirar o nosso foco;

9 - INFILTRADOS SEMPRE DIZEM QUE NÃO VAI DAR EM NADA E SÃO PESSIMISTAS (mesmo vendo tanques na rua, eles fingem que nada está acontecendo);

10 - Há grupos de petistas que se fingem de patriotas. Os admins petistas nunca banem os infiltrados.

REGRAS SOBRE INFILTRADOS

1 - Eles desconfiam das Forças Armadas e do Presidente Bolsonaro e alguns xingam o Presidente;

2 - Sempre acham que devemos sair dos quartéis e tentar outras coisas;

3 - Sempre falam que o povo deve ir para a esplanada pedir para políticos resolverem tudo (e sabemos que eles nunca resolvem nada)

4 - Alguns falam em invadir o Congresso (isso seria um novo Capitólio Brasileiro e nao resolveria nada. A policia expulsa todos e no outro dia tudo volta ao normal);

5 - Eles dizem que devemos confiar no Sistema jurídico (o sistema corrupto que atrasa o Brasil a décadas e solta bandidos);

6 - Nunca escute infiltrados. 

7 - Infiltrados sempre agem juntos nos grupos e criam um falso debate entre eles para confundir os outros;

8 - Infiltrados sempre querem debater um plano B para tirar o nosso foco dos quartéis;

9 - INFILTRADOS SEMPRE DIZEM QUE NÃO VAI DAR EM NADA, SÃO PESSIMISTAS E CHORÕES (mesmo vendo tanques na rua, eles fingem que nada está acontecendo);

11 - Infiltrados sempre propõe debates para tirar o nosso foco;

11 - Quando é desmacarado, o infiltrado sempre diz que os outros são infiltrados;

12 - Há grupos de petistas que se fingem de patriotas. Nesses grupos, os admins petistas nunca banem os infiltrados. 

13 - Deixe o infiltrado falar. Ele mesmo vai acabar se entregando;

14 - Infiltrados sempre falam que pensam diferente e se fazem de vítima quando são descobertos, dizendo que estão sendo proibidos de pensar diferente (é tudo fingimento, eles querem é enfraquecer nosso movimento e nossa confiança no Presidente e nas FFAAs);

15 - A nossa Força está em pensarmos igual e termos união plena, e os infiltrados querem incutir pensamentos diferentes para causar divisão.
